<script>
		function roomPrinter() {
				var buildingContent = document.getElementById('rooms').childNodes;
				var roomList = [];
				var i;
				var n;
				for (i = 0; i < buildingContent.length; i++) {
						roomList.push(buildingContent[i].id);

				for (nn=0; nn < roomList.length; nn++){
					console.log(roomList[nn]);
				}
		}
		roomPrinter();
	</script>
